"use strict";class fetchHtml{constructor(){}static partial(t){const e=t.getAttribute("href");return new Promise((r,n)=>{const c=new Headers,a=new Request(e,{method:"GET",headers:c,mode:"cors",cache:"default"});fetch(a).then(function(t){return 200==t.status?t.text():Promise.reject(t)}).then(e=>{"html"===t.attributes.rel.value&&(t.parentNode.innerHTML=e),r(e)}).catch(function(e){t.parentNode.innerHTML="Sorry, the data can not be found / 404"})})}}